import TodoForm from '../components/Todos/TodoForm';
import TodoList from '../components/Todos/TodoList';

const TodosPage = () => {
  return (
    <div className="page todos-page">
      <h2>Your Tasks</h2>
      <TodoForm />
      <TodoList />
    </div>
  );
};

export default TodosPage;
